import React from 'react';
import {Route, Link} from 'react-router-dom'

const Navbar = () => (
  <header>
    <nav>
      <ul>
        <li><Link to="/Register">Register</Link></li>
        <li><Link to="/Login">Login</Link></li>
		<li><Link to="/Home">Home</Link></li>
        
      </ul>
    </nav>
  </header>
);

export default Navbar;
